const Login = ()=>{
    return(
        <div>
            <h4>Login</h4>
            <form className="col-sm-10">
                Email <br/>
                <input className="form-control" type="Email" placeholder="Enter Email ID" /><br/>
                Password <br/>  
                <input className="form-control" type="password" placeholder="Enter Password" />                                
            </form>          
        </div>
    );
}

export default Login;
